import React from "react";
import Cards from "../Cards/Cards";
import Table from "../Table/Table";
import { Link } from "react-router-dom";
import "./MainDash.css";

const MainDash = () => {
  return (
    <div className="MainDash">
      <h1>Dashboard</h1>
      <Link to="/attendance">
        <button>Go to Attendance</button>
      </Link>
      <Cards />
      <Table />
    </div>
  );
};

export default MainDash;
